import { useParams } from "react-router-dom";
import App from "./App";

function DogDetails() {
  const params = useParams();

  const dogArr = App.defaultProps.dogs;

  return (
    <div>
      {dogArr.map((dog) => {
        if (params.name.toUpperCase() === dog.name.toUpperCase()) {
          let jsx = (
            <>
              <h1>{dog.name}</h1>
              <p>Age: {dog.age}</p>
              <p>{dog.facts}</p>
            </>
          );
          return jsx;
        }
      })}
    </div>
  );
}

export default DogDetails;
